(self.webpackChunk_N_E=self.webpackChunk_N_E||[]).push([[8542],{68542:function(e){"use strict";e.exports=JSON.parse('{"md":"\\n# App\\n\\nApp is the container for your Tag Revisions and connected Platforms. This model is not under revision control as it is layer above Revisions.\\n\\n| Field | Description | Type | Reference | Nullable | Deprecated |\\n|-------|-------------|------|-----------|----------|------------|\\n| id | ID of the `App` | ID | [ID](/api-docs/id) | No | No |\\n| tag_manager_account | The `TagManagerAccount` that contains the `App` | TagManagerAccount | [TagManagerAccount](/api-docs/tag-manager-account) | No | No |\\n| name | Name of the Application | String | [String](/api-docs/string) | No | No |\\n| type | The `AppType` associated with this App. Please note that currently on WEB is supported. MOBILE_APP will be introduced soon! | AppType | [AppType](/api-docs/app-type) | No | No |\\n| domain | The domain name of the `App` | String | [String](/api-docs/string) | No | No |\\n| revisions | Revisions linked to the `App`. All `App` entities such as `Tag`, `RuleGroup`, `Rule` etc. sit under a revisioning system. | List[Revision] | [Revision](/api-docs/revision) | No | No |\\n| app_platforms | All the platforms that a user has connected to (installed on) the `App`. The is the master connected list that will appear in revised models. | List[AppPlatform] | [AppPlatform](/api-docs/app-platform) | No | No |\\n| environments | Environments connected to the `App`. Environments are used to create a fixed deployment of a Revision | List[Environment] | [Environment](/api-docs/environment) | No | No |\\n| created_at | Date the `App` was created | DateTime | [DateTime](/api-docs/date-time) | No | No |\\n| updated_at | Date the `App` was last updated | DateTime | [DateTime](/api-docs/date-time) | No | No |\\n| average_session_duration_stats | Average session duration | IntResponse | [IntResponse](/api-docs/int-response) | No | No |\\n| bounce_ratio_stats | Bounce ratio | FloatResponse | [FloatResponse](/api-docs/float-response) | No | No |\\n| event_request_stats | Event request stats | AppGroupingCountsResponse | [AppGroupingCountsResponse](/api-docs/app-grouping-counts-response) | No | No |\\n| referrer_stats | Referrers | AppGroupingCountsResponse | [AppGroupingCountsResponse](/api-docs/app-grouping-counts-response) | No | No |\\n| referrer_tld_stats | Referrer TLDs | AppGroupingCountsResponse | [AppGroupingCountsResponse](/api-docs/app-grouping-counts-response) | No | No |\\n| utm_medium_stats | UTM Mediums | AppGroupingCountsResponse | [AppGroupingCountsResponse](/api-docs/app-grouping-counts-response) | No | No |\\n| utm_source_stats | UTM Sources | AppGroupingCountsResponse | [AppGroupingCountsResponse](/api-docs/app-grouping-counts-response) | No | No |\\n| utm_campaign_stats | UTM Campaigns | AppGroupingCountsResponse | [AppGroupingCountsResponse](/api-docs/app-grouping-counts-response) | No | No |\\n| page_stats | Pages | AppGroupingCountsResponse | [AppGroupingCountsResponse](/api-docs/app-grouping-counts-response) | No | No |\\n| entry_page_stats | Entry Pages | AppGroupingCountsResponse | [AppGroupingCountsResponse](/api-docs/app-grouping-counts-response) | No | No |\\n| exit_page_stats | Exit Pages | AppGroupingCountsResponse | [AppGroupingCountsResponse](/api-docs/app-grouping-counts-response) | No | No |\\n| country_stats | Countries | AppGroupingCountsResponse | [AppGroupingCountsResponse](/api-docs/app-grouping-counts-response) | No | No |\\n| device_stats | Devices | AppGroupingCountsResponse | [AppGroupingCountsResponse](/api-docs/app-grouping-counts-response) | No | No |\\n| browser_stats | Browsers | AppGroupingCountsResponse | [AppGroupingCountsResponse](/api-docs/app-grouping-counts-response) | No | No |\\n| operating_system_stats | Operating Systems | AppGroupingCountsResponse | [AppGroupingCountsResponse](/api-docs/app-grouping-counts-response) | No | No |\\n| event_stats | Events | AppGroupingCountsResponse | [AppGroupingCountsResponse](/api-docs/app-grouping-counts-response) | No | No |\\n| event_group_stats | Event Groups | AppGroupingCountsResponse | [AppGroupingCountsResponse](/api-docs/app-grouping-counts-response) | No | No |\\n\\n## Queries\\n\\n*Queries provide a function on the graph to access App entities. This should be considered the same as RESTful \'GET\'*\\n\\n---\\n\\n### Get App\\n\\n```graphql\\ngetApp(id: ID!): App\\n\\n```\\n\\nGet an App model from the App ID\\n\\n**Arguments: -**\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| id | -- | ID | [ID](/api-docs/id) | Yes |  | No |\\n\\n\\n**Returns: -**\\n\\n| Type | Reference |\\n|------|-----------|\\n| App | [App](/api-docs/app) |\\n\\n\\n\\n\\n## Mutations\\n\\n*Mutations enable us to create, modify and delete App entities. POST/PUT/DELETE methods in a RESTful API would typically provide this functionality*\\n\\n---\\n\\n### Create App\\n\\n```graphql\\ncreateApp(appCreateInput: AppCreateInput!): App\\n\\n```\\n\\nCreate a new `App`.\\n\\n**Arguments: -**\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| appCreateInput | -- | AppCreateInput | *AppCreateInput* | Yes |  | No |\\n\\n\\n**AppCreateInput**\\n\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| tag_manager_account_id | The `TagManagerAccount` under which the `App` should be created | ID | [ID](/api-docs/id) | Yes |  | No |\\n| name | The name of the new `App` being created | String | [String](/api-docs/string) | Yes |  | No |\\n| domain | `App`&#039;s domain name | String | [String](/api-docs/string) | Yes |  | No |\\n| type | The type of `App` to be created | AppType | [AppType](/api-docs/app-type) | Yes |  | No |\\n\\n\\n**Returns: -**\\n\\n| Type | Reference |\\n|------|-----------|\\n| App | [App](/api-docs/app) |\\n\\n\\n\\n\\n---\\n\\n### Update App\\n\\n```graphql\\nupdateApp(appUpdateInput: AppUpdateInput!): Boolean\\n\\n```\\n\\nUpdate a `App`&#039;s details.\\n\\n**Arguments: -**\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| appUpdateInput | -- | AppUpdateInput | *AppUpdateInput* | Yes |  | No |\\n\\n\\n**AppUpdateInput**\\n\\n*Update an `App`&#039;s properties. Please note that `AppType` can&#039;t be changed once a tag has been created.*\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| app_id | `App` ID to update data against | ID | [ID](/api-docs/id) | Yes |  | No |\\n| name | `App` name | String | [String](/api-docs/string) | No |  | No |\\n| domain | `App`&#039;s domain name | String | [String](/api-docs/string) | No |  | No |\\n\\n\\n**Returns: -**\\n\\n| Type | Reference |\\n|------|-----------|\\n| Boolean | [Boolean](/api-docs/boolean) |\\n\\n\\n\\n\\n---\\n\\n### Delete App\\n\\n```graphql\\ndeleteApp(appDeleteInput: AppDeleteInput!): Boolean\\n\\n```\\n\\nDelete a `App` and its children.\\n\\n**Arguments: -**\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| appDeleteInput | -- | AppDeleteInput | *AppDeleteInput* | Yes |  | No |\\n\\n\\n**AppDeleteInput**\\n\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| app_id | `APP` ID to delete against | ID | [ID](/api-docs/id) | Yes |  | No |\\n\\n\\n**Returns: -**\\n\\n| Type | Reference |\\n|------|-----------|\\n| Boolean | [Boolean](/api-docs/boolean) |\\n\\n\\n\\n\\n---\\n\\n### Install Platform\\n\\n```graphql\\ninstallPlatform(appInstallPlatformInput: AppInstallPlatformInput!): App\\n\\n```\\n\\nInstall a new `Platform`.\\n\\n**Arguments: -**\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| appInstallPlatformInput | -- | AppInstallPlatformInput | *AppInstallPlatformInput* | Yes |  | No |\\n\\n\\n**AppInstallPlatformInput**\\n\\n\\n| Name | Description | Type | Reference | Required | Default Value | Deprecated |\\n|------|-------------|------|-----------|----------|---------------|------------|\\n| app_id | `App` ID to install the `Platform` on | ID | [ID](/api-docs/id) | Yes |  | No |\\n| platform_id | `Platform` ID to install | ID | [ID](/api-docs/id) | Yes |  | No |\\n\\n\\n**Returns: -**\\n\\n| Type | Reference |\\n|------|-----------|\\n| App | [App](/api-docs/app) |\\n\\n\\n\\n"}')}}]);